import React from 'react';
import Navbar from './components/NavBar/Navbar';
import Intro from './components/Introduction/intro';
import Skills from './components/Skills/skills';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Intro/>
      <Skills/>
    </div>
  );
}
export default App;
